import axios from 'axios';

export const scanDatabase = async (scanEndpoint) => {
  const res = await axios.get(
    `https://weak-puce-toad-garb.cyclic.app${scanEndpoint}`
  );

  if (res.data.Count) return res.data.Items;
};
